    /**
     * 界面显示数据存储模块
     */
    private static class TablesData {
        final int id;
        final String extensionMethod;
        final String url;
        final String status;
        final String res;
        final String startTime;

        final IHttpRequestResponse requestResponse;

        public TablesData(int id, String extensionMethod, String url, String status,
                          String res, String startTime,
                          IHttpRequestResponse requestResponse) {
            this.id = id;
            this.extensionMethod = extensionMethod;
            this.url = url;
            this.status = status;
            this.res = res;
            this.startTime = startTime;
            this.requestResponse = requestResponse;
        }
    }

    /**
     * 自定义Table
     */
    private class URLTable extends JTable {
        public URLTable(TableModel tableModel) {
            super(tableModel);
        }

        @Override
        public void changeSelection(int row, int col, boolean toggle, boolean extend) {
            FastjsonPane.TablesData dataEntry = FastjsonPane.this.Udatas.get(convertRowIndexToModel(row));
            HRequestTextEditor.setMessage(dataEntry.requestResponse.getRequest(), true);
            HResponseTextEditor.setMessage(dataEntry.requestResponse.getResponse(), false);
            currentlyDisplayedItem = dataEntry.requestResponse;
            super.changeSelection(row, col, toggle, extend);
        }
    }


